import { Component } from "react";
import queryString from 'query-string';

class WebBoardModifyComponent extends Component{
    constructor(props)
    {
        super(props);

        const {bno} = queryString.parse(this.props.location.search)

        this.state = {
            bno : bno,
            board : {
                bno : bno,
                title : "",
                content : "",
                writer : "",
                regdate : ""
            }
        }

        console.log("bno is " + this.state.bno);
    }

    render(){
        return (
            <>
            <h1>hello modify {this.state.bno}</h1>
            </>
        );
    }
}

export default WebBoardModifyComponent;
